import React, { useEffect, useState } from "react";
import Link from "next/link";
import Layout from "../components/Layout";

export default function Index() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/posts")
      .then((response) => {
        return response.json();
      })
      .then((json) => {
        setData(json);
      });
  });

  return (
    <div className='p-4 shadow-lg rounded  bg-gradient-br-primary grid grid-cols-4 gap-4'>
      {data.map((item) => {
        return (
          <div className=' bg-white' key={item.title}>
            <Link href={`/aukcje/${item.id}`}>{item.title}</Link>
          </div>
        );
      })}
    </div>
  );
}
